<InstructionsGroup>
<txtInstr>EXC THE FLT OPS LISTED BLW: </txtInstr>
<txtInstr>1. ACFT ARR OR DEP AIRPORTS OR HELIPORTS WITHIN THE TFR. </txtInstr>
<txtInstr>2. LAW ENFORCEMENT, FIREFIGHTING, AND MEDEVAC/AIR AMBULANCE FLIGHTS ON ACT MISSIONS. </txtInstr>
<txtInstr>3. ACFT OPS NECESSITATED FOR SAFETY OR EMERGENCY REASONS. </txtInstr>
<txtInstr>4. ALL ACFT APPROVED TO OPERATE WI THE TFR MUST BE SQUAWKING AN ATC DISCRETE CODE AT ALL TIMES WHILE IN THE TFR AND MUST REMAIN IN TWO-WAY RADIO COM WITH ATC. </txtInstr>
<txtInstr>5. UAS OPERATORS WHO DO NOT COMPLY WITH APPLICABLE AIRSPACE RESTRICTIONS ARE WARNED THAT PURSUANT TO 10 U.S.C. SECTION 130I AND 6 U.S.C. SECTION 124N, THE DEPARTMENT OF DEFENSE (DOD), THE DEPARTMENT OF HOMELAND SECURITY (DHS) OR THE DEPARTMENT OF JUSTICE (DOJ) MAY TAKE SECURITY ACTION THAT RESULTS IN THE INTERFERENCE, DISRUPTION, SEIZURE, DAMAGING, OR DESTRUCTION OF UNMANNED AIRCRAFT DEEMED TO POSE A CREDIBLE SAFETY OR SECURITY THREAT TO PROTECTED PERSONNEL, FACILITIES, OR ASSETS. </txtInstr>
<txtInstr>6. THE SYSTEM OPERATIONS SUPPORT CENTER (SOSC), IS THE COORDINATION FACILITY FOR GOVERNMENT AGENCIES AND IS AVAILABLE DAILY FROM 0700-2300 EASTERN, PHONE 202-267-8276 FOR COORDINATION. </txtInstr>
<txtInstr>7. THE FAA RECOMMENDS THAT ALL AIRCRAFT OPERATORS CHECK NOTAMS FREQUENTLY FOR POSSIBLE CHANGES TO THIS TFR PRIOR TO OPERATIONS WITHIN THIS REGION. OPERATORS MAY REVIEW THE TFR DETAILS ON THE INTERNET AT HTTPS://TFR.FAA.GOV/ OR HTTPS://WWW.1800WXBRIEF.COM. IF QUESTIONS REMAIN, CONTACT FLIGHT SERVICE AT 800-992-7433. </txtInstr>
