<txtDescrUSNS>!FDC 3/3480 ZSE PART 1 OF 4 WA..AIRSPACE SEATTLE, WASHINGTON..TEMPORARY FLIGHT RESTRICTIONS. AUGUST 15, 2023 LOCAL. PURSUANT TO 49 USC 40103(B)(3), THE FEDERAL AVIATION ADMINISTRATION (FAA) CLASSIFIES THE AIRSPACE DEFINED IN THIS NOTAM AS 'NTL DEFENSE AIRSPACE'. PILOTS WHO DO NOT ADHERE TO THE FOLLOWING PROC MAY BE INTERCEPTED, DETAINED AND INTERVIEWED BY LAW ENFORCEMENT/SECURITY PERSONNEL. ANY OF THE FOLLOWING ADDITIONAL ACTIONS MAY ALSO BE TAKEN AGAINST A PILOT WHO DOES NOT COMPLY WITH THE RQMNTS OR ANY SPECIAL INSTRUCTIONS OR PROC ANNOUNCED IN THIS NOTAM: A) THE FAA MAY TAKE ADMINISTRATIVE ACTION, INCLUDING IMPOSING CIVIL PENALTIES AND THE SUSPENSION OR REVOCATION OF AIRMEN CERTIFICATES; OR B) THE UNITED STATES GOVERNMENT MAY PURSUE CRIMINAL CHARGES, INCLUDING CHARGES UNDER 49 USC SECTION 46307; OR C) THE UNITED STATES GOVERNMENT MAY USE DEADLY FORCE AGAINST THE AIRBORNE ACFT, IF IT IS DETERMINED THAT THE ACFT POSES AN IMMINENT SECURITY THREAT. PURSUANT TO 14 CFR 91.141, ALL ACFT FLT OPS INCLUDING REMOTE CONTROLLED ACFT OPS ARE PROHIBITED: WI AN AREA DEFINED AS 4NM 2308151730-2308152300 END PART 1 OF 4 !FDC 3/3480 ZSE PART 2 OF 4 WA..AIRSPACE SEATTLE, WASHINGTON..TEMPORARY FLIGHT RADIUS OF 473249N1221904W (SEA338006.7) SFC-2999FT AGL EFFECTIVE 2308151730 UTC (1030 LOCAL 08/15/23) UNTIL 2308152030 UTC (1330 LOCAL 08/15/23). WI AN AREA DEFINED AS 3NM RADIUS OF 473700N1221356W (SEA357011.3) SFC-2999FT AGL EFFECTIVE 2308152000 UTC (1300 LOCAL 08/15/23) UNTIL 2308152215 UTC (1515 LOCAL 08/15/23). WI AN AREA DEFINED AS 4NM RADIUS OF 473249N1221904W (SEA338006.7) SFC-2999FT AGL EFFECTIVE 2308152130 UTC (1430 LOCAL 08/15/23) UNTIL 2308152300 UTC (1600 LOCAL 08/15/23). EXC THE FLT OPS LISTED BLW: 1. ACFT ARR OR DEP AIRPORTS OR HELIPORTS WITHIN THE TFR. 2. LAW ENFORCEMENT, FIREFIGHTING, AND MEDEVAC/AIR AMBULANCE FLIGHTS ON ACT MISSIONS. 2308151730-2308152300 END PART 2 OF 4 !FDC 3/3480 ZSE PART 3 OF 4 WA..AIRSPACE SEATTLE, WASHINGTON..TEMPORARY FLIGHT 3. ACFT OPS NECESSITATED FOR SAFETY OR EMERGENCY REASONS. 4. ALL ACFT APPROVED TO OPERATE WI THE TFR MUST BE SQUAWKING AN ATC DISCRETE CODE AT ALL TIMES WHILE IN THE TFR AND MUST REMAIN IN TWO-WAY RADIO COM WITH ATC. 5. UAS OPERATORS WHO DO NOT COMPLY WITH APPLICABLE AIRSPACE RESTRICTIONS ARE WARNED THAT PURSUANT TO 10 U.S.C. SECTION 130I AND 6 U.S.C. SECTION 124N, THE DEPARTMENT OF DEFENSE (DOD), THE DEPARTMENT OF HOMELAND SECURITY (DHS) OR THE DEPARTMENT OF JUSTICE (DOJ) MAY TAKE SECURITY ACTION THAT RESULTS IN THE INTERFERENCE, DISRUPTION, SEIZURE, DAMAGING, OR DESTRUCTION OF UNMANNED AIRCRAFT DEEMED TO POSE A CREDIBLE SAFETY OR SECURITY THREAT TO PROTECTED PERSONNEL, FACILITIES, OR ASSETS. 6. THE SYSTEM OPERATIONS SUPPORT CENTER (SOSC), IS THE COORDINATION FACILITY FOR GOVERNMENT AGENCIES 2308151730-2308152300 END PART 3 OF 4 !FDC 3/3480 ZSE PART 4 OF 4 WA..AIRSPACE SEATTLE, WASHINGTON..TEMPORARY FLIGHT AND IS AVAILABLE DAILY FROM 0700-2300 EASTERN, PHONE 202-267-8276 FOR COORDINATION. 7. THE FAA RECOMMENDS THAT ALL AIRCRAFT OPERATORS CHECK NOTAMS FREQUENTLY FOR POSSIBLE CHANGES TO THIS TFR PRIOR TO OPERATIONS WITHIN THIS REGION. OPERATORS MAY REVIEW THE TFR DETAILS ON THE INTERNET AT HTTPS://TFR.FAA.GOV/ OR HTTPS://WWW.1800WXBRIEF.COM. IF QUESTIONS REMAIN, CONTACT FLIGHT SERVICE AT 800-992-7433. 2308151730-2308152300 END PART 4 OF 4</txtDescrUSNS>
<txtDescrTraditional>!FDC 3/3480 ZSE WA..AIRSPACE SEATTLE, WASHINGTON..TEMPORARY FLIGHT RESTRICTIONS. AUGUST 15, 2023 LOCAL. PURSUANT TO 49 USC 40103(B)(3), THE FEDERAL AVIATION ADMINISTRATION (FAA) CLASSIFIES THE AIRSPACE DEFINED IN THIS NOTAM AS 'NTL DEFENSE AIRSPACE'. PILOTS WHO DO NOT ADHERE TO THE FOLLOWING PROC MAY BE INTERCEPTED, DETAINED AND INTERVIEWED BY LAW ENFORCEMENT/SECURITY PERSONNEL. ANY OF THE FOLLOWING ADDITIONAL ACTIONS MAY ALSO BE TAKEN AGAINST A PILOT WHO DOES NOT COMPLY WITH THE RQMNTS OR ANY SPECIAL INSTRUCTIONS OR PROC ANNOUNCED IN THIS NOTAM: A) THE FAA MAY TAKE ADMINISTRATIVE ACTION, INCLUDING IMPOSING CIVIL PENALTIES AND THE SUSPENSION OR REVOCATION OF AIRMEN CERTIFICATES; OR B) THE UNITED STATES GOVERNMENT MAY PURSUE CRIMINAL CHARGES, INCLUDING CHARGES UNDER 49 USC SECTION 46307; OR C) THE UNITED STATES GOVERNMENT MAY USE DEADLY FORCE AGAINST THE AIRBORNE ACFT, IF IT IS DETERMINED THAT THE ACFT POSES AN IMMINENT SECURITY THREAT. PURSUANT TO 14 CFR 91.141, ALL ACFT FLT OPS INCLUDING REMOTE CONTROLLED ACFT OPS ARE PROHIBITED: WI AN AREA DEFINED AS 4NM RADIUS OF 473249N1221904W (SEA338006.7) SFC-2999FT AGL EFFECTIVE 2308151730 UTC (1030 LOCAL 08/15/23) UNTIL 2308152030 UTC (1330 LOCAL 08/15/23). WI AN AREA DEFINED AS 3NM RADIUS OF 473700N1221356W (SEA357011.3) SFC-2999FT AGL EFFECTIVE 2308152000 UTC (1300 LOCAL 08/15/23) UNTIL 2308152215 UTC (1515 LOCAL 08/15/23). WI AN AREA DEFINED AS 4NM RADIUS OF 473249N1221904W (SEA338006.7) SFC-2999FT AGL EFFECTIVE 2308152130 UTC (1430 LOCAL 08/15/23) UNTIL 2308152300 UTC (1600 LOCAL 08/15/23). EXC THE FLT OPS LISTED BLW: 1. ACFT ARR OR DEP AIRPORTS OR HELIPORTS WITHIN THE TFR. 2. LAW ENFORCEMENT, FIREFIGHTING, AND MEDEVAC/AIR AMBULANCE FLIGHTS ON ACT MISSIONS. 3. ACFT OPS NECESSITATED FOR SAFETY OR EMERGENCY REASONS. 4. ALL ACFT APPROVED TO OPERATE WI THE TFR MUST BE SQUAWKING AN ATC DISCRETE CODE AT ALL TIMES WHILE IN THE TFR AND MUST REMAIN IN TWO-WAY RADIO COM WITH ATC. 5. UAS OPERATORS WHO DO NOT COMPLY WITH APPLICABLE AIRSPACE RESTRICTIONS ARE WARNED THAT PURSUANT TO 10 U.S.C. SECTION 130I AND 6 U.S.C. SECTION 124N, THE DEPARTMENT OF DEFENSE (DOD), THE DEPARTMENT OF HOMELAND SECURITY (DHS) OR THE DEPARTMENT OF JUSTICE (DOJ) MAY TAKE SECURITY ACTION THAT RESULTS IN THE INTERFERENCE, DISRUPTION, SEIZURE, DAMAGING, OR DESTRUCTION OF UNMANNED AIRCRAFT DEEMED TO POSE A CREDIBLE SAFETY OR SECURITY THREAT TO PROTECTED PERSONNEL, FACILITIES, OR ASSETS. 6. THE SYSTEM OPERATIONS SUPPORT CENTER (SOSC), IS THE COORDINATION FACILITY FOR GOVERNMENT AGENCIES AND IS AVAILABLE DAILY FROM 0700-2300 EASTERN, PHONE 202-267-8276 FOR COORDINATION. 7. THE FAA RECOMMENDS THAT ALL AIRCRAFT OPERATORS CHECK NOTAMS FREQUENTLY FOR POSSIBLE CHANGES TO THIS TFR PRIOR TO OPERATIONS WITHIN THIS REGION. OPERATORS MAY REVIEW THE TFR DETAILS ON THE INTERNET AT HTTPS://TFR.FAA.GOV/ OR HTTPS://WWW.1800WXBRIEF.COM. IF QUESTIONS REMAIN, CONTACT FLIGHT SERVICE AT 800-992-7433. 2308151730-2308152300</txtDescrTraditional>
