 Definition:</b> </font> </TD> </TR> <TR> <TD> </TD> <TD> </TD> <TD colspan="3"> <font face="Arial" size="2">Center:</font> </TD> <TD> <font face="Arial" size="2"> On the SEATTLE VORTAC (SEA) 357 degree radial at 11.3 nautical miles. (Latitude: 47&#xBA;37'00"N, Longitude: 122&#xBA;13'56"W)</font> </TD> </TR> <TR> <TD> </TD> <TD> </TD> <TD colspan="3"> <font face="Arial" size="2">Radius:</font> </TD> <TD> <font face="Arial" size="2"> 3 nautical miles</font> </TD> </TR> <TR> <TD> </TD> <TD> </TD> <TD colspan="3"> <font face="Arial" size="2">Altitude:</font> </TD> <TD> <font face="Arial" size="2"> From the surface up to and including 2999 feet AGL </font> </TD> </TR> <TR> <TD colspan="5"> <font face="Arial" size="2"> <b>Effective Date(s):</b> </font> </TD> </TR> <TR> <TD> </TD> <TD> </TD> <TD colspan="5" valign="top"> <font face="Arial" size="2">From August 15, 2023 at 2000 UTC (August 15, 2023 at 1300 PDT)</font> </TD> </TR> <TR> <TD> </TD> <TD> </TD> <TD colspan="5" valign="top"> <font face="Arial" size="2">To August 15, 2023 at 2215 UTC (August 15, 2023 at 1515 PDT)</font> </TD> </TR> <TR> <TD colspan="2" height="10"> </TD> </TR> <TR> <TD colspan="3"> <font face="Arial" size="2"> <b>Area C</b> </font> </TD> </TR> <TR> <TD colspan="3" width="200"> <font face="Arial" size="2"> <b>Airspace Definition:</b> </font> </TD> </TR> <TR> <TD> </TD> <TD> </TD> <TD colspan="3"> <font face="Arial" size="2">Center:</font> </TD> <TD> <font face="Arial" size="2"> On the SEATTLE VORTAC (SEA) 338 degree radial at 6.7 nautical miles. (Latitude: 47&#xBA;32'49"N, Longitude: 122&#xBA;19'04"W)</font> </TD> </TR> <TR> <TD> </TD> <TD> </TD> <TD colspan="3"> <font face="Arial" size="2">Radius:</font> </TD> <TD> <font face="Arial" size="2"> 4 nautical miles</font> </TD> </TR> <TR> <TD> </TD> <TD> </TD> <TD colspan="3"> <font face="Arial" size="2">Altitude:</font> </TD> <TD> <font face="Arial" size="2"> From the surface up to and including 2999 feet AGL </font> </TD> </TR> <TR> <TD colspan="5"> <font face="Arial" size="2"> <b>Effective Date(s):</b> </font> </TD> </TR> <TR> <TD> </TD> <TD> </TD> <TD colspan="5" valign="top"> <font face="Arial" size="2">From August 15, 2023 at 2130 UTC (August 15, 2023 at 1430 PDT)</font> </TD> </TR> <TR> <TD> </TD> <TD> </TD> <TD colspan="5" valign="top"> <font face="Arial" size="2">To August 15, 2023 at 2300 UTC (August 15, 2023 at 1600 PDT)</font> </TD> </TR> <TR> <TD colspan="2" height="20"> </TD> </TR> </Table> <b>ENDSECTION1</b> <Table cellpadding="1" cellspacing="0"> <TR bgcolor="#1E90FF"> <TD colspan="3"> <a name="restrictions"> <b> <font color="#FFFFFF" face="Arial" size="3">Operating Restrictions and Requirements</font> </b> </a> </TD> <TD colspan="1" align="right"> <a href="#"> <font color="#FFFFFF" face="Arial"> <b>Top</b> </font> </a> </TD> </TR> <TR> <TD colspan="2" height="20"> </TD> </TR> <TR> <TD colspan="3"> <font face="Arial" size="2">No pilots may operate an aircraft in the areas covered by this NOTAM (except as described).</font> </TD> </TR> <TR> <TD colspan="2" height="20"> </TD> </TR> <TR> <TD> <font face="Arial" size="2"> <DL> <DT>EXC THE FLT OPS LISTED BLW: </DT><br/><DD> <OL> <LI> ACFT ARR OR DEP AIRPORTS OR HELIPORTS WITHIN THE TFR. </LI><br/><LI> LAW ENFORCEMENT, FIREFIGHTING, AND MEDEVAC/AIR AMBULANCE FLIGHTS ON ACT MISSIONS. </LI><br/><LI> ACFT OPS NECESSITATED FOR SAFETY OR EMERGENCY REASONS. </LI><br/><LI> ALL ACFT APPROVED TO OPERATE WI THE TFR MUST BE SQUAWKING AN ATC DISCRETE CODE AT ALL TIMES WHILE IN THE TFR AND MUST REMAIN IN TWO-WAY RADIO COM WITH ATC. </LI><br/><LI> UAS OPERATORS WHO DO NOT COMPLY WITH APPLICABLE AIRSPACE RESTRICTIONS ARE WARNED THAT PURSUANT TO 10 U.S.C. SECTION 130I AND 6 U.S.C. SECTION 124N, THE DEPARTMENT OF DEFENSE (DOD), THE DEPARTMENT OF HOMELAND SECURITY (DHS) OR THE DEPARTMENT OF JUSTICE (DOJ) MAY TAKE SECURITY ACTION THAT RESULTS IN THE INTERFERENCE, DISRUPTION, SEIZURE, DAMAGING, OR DESTRUCTION OF UNMANNED AIRCRAFT DEEMED TO POSE A CREDIBLE SAFETY OR SECURITY THREAT TO PROTECTED PERSONNEL, FACILITIES, OR ASSETS. </LI><br/><LI> THE SYSTEM OPERATIONS SUPPORT CENTER (SOSC), IS THE COORDINATION FACILITY FOR GOVERNMENT AGENCIES AND IS AVAILABLE DAILY FROM 0700-2300 EASTERN, PHONE 202-267-8276 FOR COORDINATION. </LI><br/><LI> THE FAA RECOMMENDS THAT ALL AIRCRAFT OPERATORS CHECK NOTAMS FREQUENTLY FOR POSSIBLE CHANGES TO THIS TFR PRIOR TO OPERATIONS WITHIN THIS REGION. OPERATORS MAY REVIEW THE TFR DETAILS ON THE INTERNET AT HTTPS://TFR.FAA.GOV/ OR HTTPS://WWW.1800WXBRIEF.COM. IF QUESTIONS REMAIN, CONTACT FLIGHT SERVICE AT 800-992-7433. </LI><br/></OL> </DD></DL> </font> </TD> </TR> <TR> <TD colspan="2" height="10"> </TD> </TR> </Table> <Table cellpadding="1" cellspacing="0"> <TR bgcolor="#1E90FF"> <TD colspan="3"> <a name="other"> <b> <font color="#FFFFFF" face="Arial" size="3">Other Information:</font> </b> </a> </TD> <TD colspan="1" align="right"> <a href="#"> <font color="#FFFFFF" face="Arial"> <b>Top</b> </font> </a> </TD> </TR> <TR> <TD colspan="2"> <font face="Arial" size="2">ARTCC:</font> </TD> <TD> <font face="Arial" size="2">ZSE - Seattle Center</font> </TD> </TR> <TR> <TD colspan="2"> <font face="Arial" size="2">Authority:</font> </TD> <TD> <font face="Arial" size="2">Title 14 CFR section 91.141</font> </TD> </TR> <TR> <TD Width="40" /> <TD Width="152" /> <TD Width="318" /> </TR> </Table> </Body> </span> </html></txtDescrModern>
