<txtDescrUSNS>!FDC 9/2934 ZFW TX.. FLIGHT RESTRICTION. DALLAS, TEXAS. PURSUANT TO 49 USC 40103(B), THE FEDERAL AVIATION ADMINISTRATION (FAA) CLASSIFIES THE AIRSPACE DEFINED IN THIS NOTAM AS 'NATIONAL DEFENSE AIRSPACE'. ANY PERSON WHO KNOWINGLY OR WILLFULLY VIOLATES THE RULES CONCERNING OPERATIONS IN THIS AIRSPACE MAY BE SUBJECT TO CERTAIN CRIMINAL PENALTIES UNDER 49 USC 46307. PILOTS WHO DO NOT ADHERE TO THE FOLLOWING PROCEDURES MAY BE INTERCEPTED, DETAINED AND INTERVIEWED BY LAW ENFORCEMENT/SECURITY PERSONNEL. PURSUANT TO TITLE 14, SECTION 91.141 OF THE CODE OF FEDERAL REGULATIONS, AIRCRAFT FLIGHT OPERATIONS ARE PROHIBITED WITHIN THE FOLLOWING AREA(S) UNLESS OTHERWISE AUTHORIZED BY ATC WITHIN A 1 NMR OF 325321N/0964835W OR THE CVE085004.8 UP TO AND INCLUDING 1500 FT AGL EFFECTIVE IMMEDIATELY UNTIL FURTHER NOTICE.</txtDescrUSNS>
<txtDescrTraditional>!FDC 9/2934 ZFW TX..AIRSPACE DALLAS, TEXAS..TEMPORARY FLIGHT RESTRICTION. PURSUANT TO 49 USC 40103(B)(3), THE FEDERAL AVIATION ADMINISTRATION (FAA) CLASSIFIES THE AIRSPACE DEFINED IN THIS NOTAM AS 'NTL DEFENSE AIRSPACE'. ANY PERSON WHO KNOWINGLY OR WILLFULLY VIOLATES THE RULES CONCERNING OPS IN THIS AIRSPACE MAY BE SUBJECT TO CERTAIN CRIMINAL PENALTIES UNDER 49 USC 40103(B)(3). PILOTS WHO DO NOT ADHERE TO THE FOLLOWING PROC MAY BE INTERCEPTED, DETAINED AND INTERVIEWED BY LAW ENFORCEMENT/SECURITY PERSONNEL. PURSUANT TO 14 CFR 91.141, ALL ACFT FLT OPS INCLUDING REMOTE CONTROLLED ACFT OPS ARE PROHIBITED: WI THE SPECIFIED AREA(S) UNLESS OTHERWISE AUTH BY ATC WI AN AREA DEFINED AS 1NM RADIUS OF 325321N0964835W (CVE085004.8) SFC-1500FT AGL EFFECTIVE IMMEDIATELY UNTIL FURTHER NOTICE. 2308140928-PERM</txtDescrTraditional>
