<txtDescrUSNS>!FDC 1/1155 ZDC DC .. FLIGHT RESTRICTIONS, WASHINGTON, DC. EFFECTIVE 1101102040 UTC UNTIL FURTHER NOTICE. THIS NOTICE WILL REPLACE NOTAM 0/9463 DUE TO TECHNICAL ERROR, NO CHANGES IN RESTRICTIONS. PURSUANT TO TITLE 14 CFR SECTION 99.7, SPECIAL SECURITY INSTRUCTIONS. A. EXCEPT FOR FAA APPROVED DOD, LAW ENFORCEMENT, AND WAIVERED LIFEGUARD/AIR AMBULANCE FLIGHTS, ALL VFR AIRCRAFT OPERATIONS WITHIN 30NM OF 385134N/0770211W OR THE WASHINGTON /DCA/ VOR/DME, FROM THE SURFACE UP TO BUT NOT INCLUDING FL180, ARE RESTRICTED TO AN INDICATED AIRSPEED OF 180 KNOTS OR LESS, IF CAPABLE. IF UNABLE, THE PILOT MUST CONTACT THE APPROPRIATE ATC FACILITY AND ADVISE THEM OF THE AIRCRAFT'S OPERATIONAL LIMITATIONS. B. ALL VFR AIRCRAFT OPERATIONS WITHIN THE AIRSPACE BETWEEN 30 NMR AND 60 NMR OF 385134N/0770211W OR THE WASHINGTON /DCA/ VOR/DME, FROM THE SURFACE UP TO BUT NOT INCLUDING FL180, ARE RESTRICTED TO AN INDICATED AIRSPEED OF 230 KNOTS OR LESS, IF CAPABLE. IF UNABLE THE PILOT MUST CONTACT THE APPROPRIATE ATC FACILITY AND ADVISE THEM OF THE AIRCRAFT'S OPERATIONAL LIMITATIONS PRIOR TO ENTERING THE 60 NMR OF THE WASHINGTON /DCA/ VOR/DME.</txtDescrUSNS>
<txtDescrTraditional>!FDC 1/1155 ZDC DC..AIRSPACE 55 ZDC, DC..TEMPORARY FLIGHT RESTRICTION. PURSUANT TO 49 USC 40103(B)(3), THE FEDERAL AVIATION ADMINISTRATION (FAA) CLASSIFIES THE AIRSPACE DEFINED IN THIS NOTAM AS 'NATIONAL DEFENSE AIRSPACE'. PILOTS WHO DO NOT ADHERE TO THE FOLLOWING PROCEDURES MAY BE INTERCEPTED, DETAINED AND INTERVIEWED BY LAW ENFORCEMENT/SECURITY PERSONNEL. ANY OF THE FOLLOWING ADDITIONAL ACTIONS MAY ALSO BE TAKEN AGAINST A PILOT WHO DOES NOT COMPLY WITH THE REQUIREMENTS OR ANY SPECIAL INSTRUCTIONS OR PROCEDURES ANNOUNCED IN THIS NOTAM: A) THE FAA MAY TAKE ADMINISTRATIVE ACTION, INCLUDING IMPOSING CIVIL PENALTIES AND THE SUSPENSION OR REVOCATION OF AIRMEN CERTIFICATES; OR B) THE UNITED STATES GOVERNMENT MAY PURSUE CRIMINAL CHARGES, INCLUDING CHARGES UNDER TITLE 49 OF THE UNITED STATES CODE, SECTION 46307; OR C) THE UNITED STATES GOVERNMENT MAY USE DEADLY FORCE AGAINST THE AIRBORNE AIRCRAFT, IF IT IS DETERMINED THAT THE AIRCRAFT POSES AN IMMINENT SECURITY THREAT. PURSUANT TO TITLE 14 CFR SECTION 99.7, SPECIAL SECURITY INSTRUCTIONS, ALL AIRCRAFT FLIGHT OPERATIONS ARE PROHIBITED WITHIN AN AREA DEFINED AS 30NM RADIUS OF 385134N0770211W OR THE 000 NAVAID EFFECTIVE IMMEDIATELY UNTIL FURTHER NOTICE. 2105290426-PERM</txtDescrTraditional>
