<txtDescrUSNS>!FDC 2/8051 ZUA PART 1 OF 2 GU..AIRSPACE S. FINEGAYAN, GU..TEMPORARY FLIGHT RESTRICTIONS. SEPTEMBER 16 , 2022-SEPTEMBER 16 2023 LOCAL. PURSUANT TO 49 USC 40103(B)(3), THE FEDERAL AVIATION ADMINISTRATION (FAA) CLASSIFIES THE AIRSPACE DEFINED IN THIS NOTAM AS 'NTL DEFENSE AIRSPACE'. ANY PERSON WHO KNOWINGLY OR WILLFULLY VIOLATES THE RULES CONCERNING OPS IN THIS AIRSPACE MAY BE SUBJECT TO CERTAIN CRIMINAL PENALTIES UNDER 49 USC 40103(B)(3). PILOTS WHO DO NOT ADHERE TO THE FOLLOWING PROC MAY BE INTERCEPTED, DETAINED AND INTERVIEWED BY LAW ENFORCEMENT/SECURITY PERSONNEL. PURSUANT TO 14 CFR 99.7, SPECIAL SECURITY INSTRUCTIONS, ALL ACFT FLT OPS ARE PROHIBITED: WI AN AREA DEFINED AS 133332N1445054E (UNZ045009.2) TO 133308N1445002E (UNZ043008.3) TO 133229N1444923E (UNZ043007.4) THEN CLOCKWISE ON A 0.92 NM ARC CENTERED ON 133308N1445002E (UNZ043008.3) TO THE POINT OF ORIGIN SFC-6000FT MSL EFFECTIVE 2209151530 UTC (0130 LOCAL 09/16/22) UNTIL 2309151500 UTC (0100 LOCAL 09/16/23). 2209151530-2309151500 END PART 1 OF 2 !FDC 2/8051 ZUA PART 2 OF 2 GU..AIRSPACE S. FINEGAYAN, GU..TEMPORARY FLIGHT THE ABOVE DEFINED AIRSPACE CONTAINS CONTINUOUS MILITARY ACTIVITY WHICH CREATES A SERIOUS HAZARD TO AVIATION. AIRCRAFT FLYING WITHIN THE ABOVE AIRSPACE WILL BE EXPOSED TO DIRECT RADIATION WHICH MAY PRODUCE HARMFUL EFFECTS TO PERSONNEL AND EQUIPMENT. RADIATION IS NOT VISUALLY APPARENT AND SHOULD BE PRESUMED BY ALL PILOTS TO CONTINUOUSLY EXIST. LEE WEBBER, TELEPHONE 671-473-1234, IS THE POINT OF CTC FOR THE AIRSPACE. GUAM /ZUA/ CERAP, TEL 671-473-1210, IS THE FAA CDN FACILITY. 2209151530-2309151500 END PART 2 OF 2</txtDescrUSNS>
