<InstructionsGroup>
<txtInstr>EXC AS SPECIFIED BLW AND/OR UNLESS AUTH BY ATC IN CONSULTATION WITH THE AIR TFC SECURITY COORDINATOR VIA THE DOMESTIC EVENTS NETWORK (DEN): </txtInstr>
<txtInstr>A. ALL ACFT OPS WI THE 10NM RADIUS AREA(S) LISTED ABV, KNOWN AS THE INNER CORE(S), ARE PROHIBITED EXC FOR: APPROVED LAW ENFORCEMENT, MIL ACFT DIRECTLY SUPPORTING THE UNITED STATES SECRET SERVICE(USSS) AND THE OFFICE OF THE PRESIDENT OF THE UNITED STATES, APPROVED AIR AMBULANCE FLIGHTS, AND REGULARLY SCHEDULED COMMERCIAL PAX AND ALL - CARGO CARRIERS OPR UNDER ONE OF THE FOLLOWING TSA - APPROVED STANDARD SECURITY PROGRAMS / PROC AND ARE ARR INTO AND / OR DEP FM 14 CFR PART 139 AP: ACFT OPR STANDARD SECURITY PROGRAM(AOSSP), FULL ALL - CARGO ACFT OPR STANDARD SECURITY PROGRAM(FACAOSSP), MODEL SECURITY PROGRAM(MSP), TWELVE FIVE STANDARD SECURITY PROGRAM ALL CARGO(TFSSP - ALL CARGO), OR ALL - CARGO INTERNATIONAL SECURITY PROC(ACISP). ALL EMERGENCY / LIFE SAVING FLT(MEDICAL / LAW ENFORCEMENT / FIREFIGHTING) OPS MUST COORDINATE WITH ATC PRIOR TO THEIR DEP AT 916-366-4080 TO AVOID POTENTIAL DELAYS.</txtInstr>
<txtInstr>B. FOR OPS WI THE AIRSPACE BTN THE 10NM RADIUS AND 30NM RADIUS AREA(S) LISTED ABV, KNOWN AS THE OUTER RING(S): ALL ACFT OPR WI THE OUTER RING(S) LISTED ABV ARE LIMITED TO ACFT ARR OR DEP LOCAL AIRFIELDS, AND WORKLOAD PERMITTING, ATC MAY AUTHORIZE TRANSIT OPS. ACFT MAY NOT LOITER. ALL ACFT MUST BE ON AN ACT IFR OR FILED VFR FLT PLAN WITH A DISCRETE CODE ASSIGNED BY AN AIR TFC CTL (ATC) FAC. ACFT MUST BE SQUAWKING THE DISCRETE CODE PRIOR TO DEP AND AT ALL TIMES WHILE IN THE TFR AND MUST REMAIN IN TWO-WAY RADIO COM WITH ATC. </txtInstr>
<txtInstr>C. THE FOLLOWING OPS ARE NOT AUTH WI THIS TFR: FLT TRAINING, PRACTICE INSTRUMENT APCH, AEROBATIC FLT, GLIDER OPS, PARACHUTE OPS, ULTRALIGHT, HANG GLIDING, BALLOON OPS, AGRICULTURE/CROP DUSTING, ANIMAL POPULATION CTL FLT OPS, BANNER TOWING OPS, SIGHTSEEING OPS, MAINTENANCE TEST FLIGHTS, MODEL ACFT OPS, MODEL ROCKETRY, UNMANNED ACFT SYSTEMS (UAS), AND UTILITY AND PIPELINE SURVEY OPS. </txtInstr>
<txtInstr>D. UAS OPR WHO DO NOT COMPLY WITH APPLICABLE AIRSPACE RESTRICTIONS ARE WARNED THAT PURSUANT TO 10 U.S.C. SECTION 130I AND 6 U.S.C. SECTION 124N, THE DEPARTMENT OF DEFENSE (DOD), THE DEPARTMENT OF HOMELAND SECURITY (DHS) OR THE DEPARTMENT OF JUSTICE (DOJ) MAY TAKE SECURITY ACTION THAT RESULTS IN THE INTERFERENCE, DISRUPTION, SEIZURE, DAMAGING, OR DESTRUCTION OF UNMANNED ACFT DEEMED TO POSE A CREDIBLE SAFETY OR SECURITY THREAT TO PROTECTED PERSONNEL, FAC, OR ASSETS.</txtInstr>
<txtInstr>E. THE SYSTEM OPERATIONS SUPPORT CENTER (SOSC), IS THE COORDINATION FACILITY FOR GOVERNMENT AGENCIES AND IS AVAILABLE DAILY FROM 0700-2300 EASTERN, PHONE 202-267-8276 FOR COORDINATION. </txtInstr>
<txtInstr>F. THE FAA RECOMMENDS THAT ALL AIRCRAFT OPERATORS CHECK NOTAMS FREQUENTLY FOR POSSIBLE CHANGES TO THIS TFR PRIOR TO OPERATIONS WITHIN THIS REGION. OPERATORS MAY REVIEW THE TFR DETAILS ON THE INTERNET AT HTTPS://TFR.FAA.GOV/ OR HTTPS://WWW.1800WXBRIEF.COM. IF QUESTIONS REMAIN, CONTACT FLIGHT SERVICE AT 800-992-7433. </txtInstr>
