<txtDescrUSNS>!FDC 3/0198 ZOA PART 1 OF 6 CA..AIRSPACE WOODSIDE, CALIFORNIA..TEMPORARY FLIGHT RESTRICTIONS. NOVEMBER 15, 2023 LOCAL. THIS NOTAM REPLACES NOTAM 3/9960 DUE TO MULTIPLE CHANGES,. PURSUANT TO 49 USC 40103(B)(3), THE FEDERAL AVIATION ADMINISTRATION (FAA) CLASSIFIES THE AIRSPACE DEFINED IN THIS NOTAM AS 'NTL DEFENSE AIRSPACE'. PILOTS WHO DO NOT ADHERE TO THE FOLLOWING PROC MAY BE INTERCEPTED, DETAINED AND INTERVIEWED BY LAW ENFORCEMENT/SECURITY PERSONNEL. ANY OF THE FOLLOWING ADDITIONAL ACTIONS MAY ALSO BE TAKEN AGAINST A PILOT WHO DOES NOT COMPLY WITH THE RQMNTS OR ANY SPECIAL INSTRUCTIONS OR PROC ANNOUNCED IN THIS NOTAM: A) THE FAA MAY TAKE ADMINISTRATIVE ACTION, INCLUDING IMPOSING CIVIL PENALTIES AND THE SUSPENSION OR REVOCATION OF AIRMEN CERTIFICATES; OR B) THE UNITED STATES GOVERNMENT MAY PURSUE CRIMINAL CHARGES, INCLUDING CHARGES UNDER 49 USC SECTION 46307; OR C) THE UNITED STATES GOVERNMENT MAY USE DEADLY FORCE AGAINST THE 2311151745-2311160245 END PART 1 OF 6 !FDC 3/0198 ZOA PART 2 OF 6 CA..AIRSPACE WOODSIDE, CALIFORNIA..TEMPORARY FLIGHT AIRBORNE ACFT, IF IT IS DETERMINED THAT THE ACFT POSES AN IMMINENT SECURITY THREAT. PURSUANT TO 14 CFR 91.141, ALL ACFT FLT OPS INCLUDING REMOTE CONTROLLED ACFT OPS ARE PROHIBITED: WI AN AREA DEFINED AS 30NM RADIUS OF 372245N1221427W (OSI095002.1) SFC-17999FT MSL EFFECTIVE 2311151745 UTC (0945 LOCAL 11/15/23) UNTIL 2311160245 UTC (1845 LOCAL 11/15/23). WI AN AREA DEFINED AS 10NM RADIUS OF 372245N1221427W (OSI095002.1) SFC-17999FT MSL EFFECTIVE 2311151745 UTC (0945 LOCAL 11/15/23) UNTIL 2311160245 UTC (1845 LOCAL 11/15/23). EXC AS SPECIFIED BLW AND/OR UNLESS AUTH BY ATC IN CONSULTATION WITH THE AIR TFC SECURITY COORDINATOR VIA THE DOMESTIC EVENTS NETWORK (DEN): 2311151745-2311160245 END PART 2 OF 6 !FDC 3/0198 ZOA PART 3 OF 6 CA..AIRSPACE WOODSIDE, CALIFORNIA..TEMPORARY FLIGHT A. ALL ACFT OPS WI THE 10NM RADIUS AREA(S) LISTED ABV, KNOWN AS THE INNER CORE(S), ARE PROHIBITED EXC FOR: APPROVED LAW ENFORCEMENT, MIL ACFT DIRECTLY SUPPORTING THE UNITED STATES SECRET SERVICE(USSS) AND THE OFFICE OF THE PRESIDENT OF THE UNITED STATES, APPROVED AIR AMBULANCE FLIGHTS, AND REGULARLY SCHEDULED COMMERCIAL PAX AND ALL - CARGO CARRIERS OPR UNDER ONE OF THE FOLLOWING TSA - APPROVED STANDARD SECURITY PROGRAMS / PROC AND ARE ARR INTO AND / OR DEP FM 14 CFR PART 139 AP: ACFT OPR STANDARD SECURITY PROGRAM(AOSSP), FULL ALL - CARGO ACFT OPR STANDARD SECURITY PROGRAM(FACAOSSP), MODEL SECURITY PROGRAM(MSP), TWELVE FIVE STANDARD SECURITY PROGRAM ALL CARGO(TFSSP - ALL CARGO), OR ALL - CARGO INTERNATIONAL SECURITY PROC(ACISP). ALL EMERGENCY / LIFE SAVING FLT(MEDICAL / LAW ENFORCEMENT / FIREFIGHTING) OPS MUST COORDINATE WITH ATC PRIOR 2311151745-2311160245 END PART 3 OF 6 !FDC 3/0198 ZOA PART 4 OF 6 CA..AIRSPACE WOODSIDE, CALIFORNIA..TEMPORARY FLIGHT TO THEIR DEP AT 916-366-4080 TO AVOID POTENTIAL DELAYS. B. FOR OPS WI THE AIRSPACE BTN THE 10NM RADIUS AND 30NM RADIUS AREA(S) LISTED ABV, KNOWN AS THE OUTER RING(S): ALL ACFT OPR WI THE OUTER RING(S) LISTED ABV ARE LIMITED TO ACFT ARR OR DEP LOCAL AIRFIELDS, AND WORKLOAD PERMITTING, ATC MAY AUTHORIZE TRANSIT OPS. ACFT MAY NOT LOITER. ALL ACFT MUST BE ON AN ACT IFR OR FILED VFR FLT PLAN WITH A DISCRETE CODE ASSIGNED BY AN AIR TFC CTL (ATC) FAC. ACFT MUST BE SQUAWKING THE DISCRETE CODE PRIOR TO DEP AND AT ALL TIMES WHILE IN THE TFR AND MUST REMAIN IN TWO-WAY RADIO COM WITH ATC. C. THE FOLLOWING OPS ARE NOT AUTH WI THIS TFR: FLT TRAINING, PRACTICE INSTRUMENT APCH, AEROBATIC FLT, GLIDER OPS, PARACHUTE OPS, ULTRALIGHT, HANG GLIDING, BALLOON OPS, AGRICULTURE/CROP DUSTING, ANIMAL POPULATION CTL FLT OPS, BANNER TOWING OPS, SIGHTSEEING OPS, MAINTENANCE TEST FLIGHTS, MODEL 2311151745-2311160245 END PART 4 OF 6 !FDC 3/0198 ZOA PART 5 OF 6 CA..AIRSPACE WOODSIDE, CALIFORNIA..TEMPORARY FLIGHT ACFT OPS, MODEL ROCKETRY, UNMANNED ACFT SYSTEMS (UAS), AND UTILITY AND PIPELINE SURVEY OPS. D. UAS OPR WHO DO NOT COMPLY WITH APPLICABLE AIRSPACE RESTRICTIONS ARE WARNED THAT PURSUANT TO 10 U.S.C. SECTION 130I AND 6 U.S.C. SECTION 124N, THE DEPARTMENT OF DEFENSE (DOD), THE DEPARTMENT OF HOMELAND SECURITY (DHS) OR THE DEPARTMENT OF JUSTICE (DOJ) MAY TAKE SECURITY ACTION THAT RESULTS IN THE INTERFERENCE, DISRUPTION, SEIZURE, DAMAGING, OR DESTRUCTION OF UNMANNED ACFT DEEMED TO POSE A CREDIBLE SAFETY OR SECURITY THREAT TO PROTECTED PERSONNEL, FAC, OR ASSETS. E. THE SYSTEM OPERATIONS SUPPORT CENTER (SOSC), IS THE COORDINATION FACILITY FOR GOVERNMENT AGENCIES AND IS AVAILABLE DAILY FROM 0700-2300 EASTERN, PHONE 202-267-8276 FOR COORDINATION. F. THE FAA RECOMMENDS THAT ALL AIRCRAFT OPERATORS CHECK NOTAMS FREQUENTLY FOR POSSIBLE CHANGES TO THIS TFR PRIOR TO OPERATIONS WITHIN THIS REGION. 2311151745-2311160245 END PART 5 OF 6 !FDC 3/0198 ZOA PART 6 OF 6 CA..AIRSPACE WOODSIDE, CALIFORNIA..TEMPORARY FLIGHT OPERATORS MAY REVIEW THE TFR DETAILS ON THE INTERNET AT HTTPS://TFR.FAA.GOV/ OR HTTPS://WWW.1800WXBRIEF.COM. IF QUESTIONS REMAIN, CONTACT FLIGHT SERVICE AT 800-992-7433. 2311151745-2311160245 END PART 6 OF 6</txtDescrUSNS>
